/**
 * Tune result on worker.
 */
export type TuneResult = {
    /**
     * Number of assets from tune request that are available.
     */
    number_of_available_assets?: number | null;
    /**
     * Tune generated assets. This field is filled only when tune was successful.
     */
    output_assets?: Array<string> | null;
    /**
     * Tune rejected assets.
     */
    rejected_assets?: Array<string> | null;
    /**
     * Tune unready assets.
     */
    unready_assets?: Array<string> | null;
};
